import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  position: relative;
  & > .back {
    width: 100%;
    height: 621px;
    background-color: #47d99b;
    border-bottom-left-radius: 200px;
  }
`;

function Section1() {
  return (
    <Wrapper>
      <div className="back" />
      <div></div>
    </Wrapper>
  );
}

export default Section1;
